import React from 'react';

import Particles from 'react-particles-js';

import Tetris from './components/Tetris';

import './App.css';

const particlesOptions = {

  polygon: {
    enable: true,
      type: 'inside',
        move: {
          radius: 10
        },
        url: 'path/to/svg.svg'
      }
    }


const App = () => (

  <div className='App'>

    <Particles

        params={particlesOptions}

      />

    <Tetris />

  </div>


);

export default App;
